// -*- mode: web-mode -*-
import './Header.css'
import { Link } from 'react-router-dom'

const Header = () => {
    return (
      <header className="header-container">
          <h1 className="app-name">Swolog</h1>
          <nav>
            <a href="/register">Register</a>
            <a href="/user">User</a>
          </nav>
      </header>      
    )
}

export default Header
